import React, { useState, useEffect } from 'react';
import { PlusIcon, PencilIcon, TrashIcon, BuildingOfficeIcon, MapPinIcon, UsersIcon } from '@heroicons/react/24/outline';
import toast from 'react-hot-toast';
import axios from 'axios';

// Set up axios defaults
axios.defaults.baseURL = 'http://localhost:5000';

function Rooms() {
  const [rooms, setRooms] = useState([]);
  const [loading, setLoading] = useState(true);
  const [showModal, setShowModal] = useState(false);
  const [editingRoom, setEditingRoom] = useState(null);
  const [searchTerm, setSearchTerm] = useState('');
  const [filterBuilding, setFilterBuilding] = useState('');

  const [formData, setFormData] = useState({
    room_number: '',
    room_name: '',
    building: '',
    capacity: '',
    room_type: 'classroom'
  });

  const roomTypes = [
    { value: 'classroom', label: 'Classroom' },
    { value: 'laboratory', label: 'Laboratory' },
    { value: 'office', label: 'Office' }
  ];

  useEffect(() => {
    fetchRooms();
  }, []);

  const fetchRooms = async () => {
    try {
      setLoading(true);
      const token = localStorage.getItem('token');

      if (!token) {
        toast.error('Please login to access rooms');
        return;
      }

      const headers = { Authorization: `Bearer ${token}` };
      const response = await axios.get('/api/rooms', { headers });

      setRooms(response.data.rooms || []);
    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`2136123395_50_6_50_51_11`,'Error fetching rooms:', error));
      if (error.response?.status === 401) {
        toast.error('Session expired. Please login again.');
        localStorage.removeItem('token');
        window.location.href = '/login';
      } else {
        toast.error('Failed to load rooms');
      }
    } finally {
      setLoading(false);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const token = localStorage.getItem('token');
      const headers = { Authorization: `Bearer ${token}` };

      if (editingRoom) {
        // Update existing room
        await axios.put(`/api/rooms/${editingRoom.ROOMID}`, formData, { headers });
        toast.success('Room updated successfully');
      } else {
        // Create new room
        await axios.post('/api/rooms', formData, { headers });
        toast.success('Room created successfully');
      }

      await fetchRooms(); // Refresh data
      setShowModal(false);
      resetForm();
      setEditingRoom(null);
    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`2136123395_84_6_84_48_11`,'Error saving room:', error));
      if (error.response?.data?.message) {
        toast.error(error.response.data.message);
      } else {
        toast.error('Failed to save room');
      }
    }
  };

  const resetForm = () => {
    setFormData({
      room_number: '',
      room_name: '',
      building: '',
      capacity: '',
      room_type: 'classroom'
    });
  };

  const handleEdit = (room) => {
    setEditingRoom(room);
    setFormData({
      room_number: room.ROOMNUMBER || '',
      room_name: room.ROOMNAME || '',
      building: room.BUILDING || '',
      capacity: room.CAPACITY || '',
      room_type: room.room_type || 'classroom'
    });
    setShowModal(true);
  };

  const handleDelete = async (roomId) => {
    if (window.confirm('Are you sure you want to delete this room?')) {
      try {
        const token = localStorage.getItem('token');
        const headers = { Authorization: `Bearer ${token}` };

        await axios.delete(`/api/rooms/${roomId}`, { headers });
        await fetchRooms(); // Refresh data
        toast.success('Room deleted successfully');
      } catch (error) {
        /* eslint-disable */console.error(...oo_tx(`2136123395_125_8_125_52_11`,'Error deleting room:', error));
        if (error.response?.data?.message) {
          toast.error(error.response.data.message);
        } else {
          toast.error('Failed to delete room');
        }
      }
    }
  };

  // Get unique buildings for filter
  const buildings = [...new Set(rooms.map(room => room.BUILDING).filter(Boolean))];

  // Filter rooms based on search and building filter
  const filteredRooms = rooms.filter(room => {
    const matchesSearch = 
      room.ROOMNUMBER?.toLowerCase().includes(searchTerm.toLowerCase()) ||
      room.ROOMNAME?.toLowerCase().includes(searchTerm.toLowerCase()) ||
      room.BUILDING?.toLowerCase().includes(searchTerm.toLowerCase());

    const matchesBuilding = !filterBuilding || room.BUILDING === filterBuilding;

    return matchesSearch && matchesBuilding;
  });

  const getRoomStatusColor = (status) => {
    switch (status) {
      case 'Available':
        return 'bg-green-100 text-green-800';
      case 'Maintenance':
        return 'bg-yellow-100 text-yellow-800';
      default:
        return 'bg-gray-100 text-gray-800';
    }
  };

  const getRoomTypeIcon = (type) => {
    switch (type) {
      case 'laboratory':
        return 'ðŸ§ª';
      case 'office':
        return 'ðŸ¢';
      default:
        return 'ðŸ«';
    }
  };

  if (loading) {
    return (
      <div className="flex items-center justify-center h-64">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-600"></div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Header */}
      <div className="flex justify-between items-center">
        <div>
          <h1 className="text-2xl font-bold text-gray-900">Room Management</h1>
          <p className="text-gray-600">Manage classrooms, laboratories, and office spaces</p>
        </div>
        <button
          onClick={() => setShowModal(true)}
          className="inline-flex items-center px-4 py-2 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-blue-600 hover:bg-blue-700"
        >
          <PlusIcon className="h-4 w-4 mr-2" />
          Add Room
        </button>
      </div>

      {/* Filters */}
      <div className="bg-white p-4 rounded-lg shadow border border-gray-200">
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-2">Search Rooms</label>
            <input
              type="text"
              placeholder="Search by room number, name, or building..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              className="w-full border border-gray-300 rounded-md px-3 py-2"
            />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-2">Filter by Building</label>
            <select
              value={filterBuilding}
              onChange={(e) => setFilterBuilding(e.target.value)}
              className="w-full border border-gray-300 rounded-md px-3 py-2"
            >
              <option value="">All Buildings</option>
              {buildings.map(building => (
                <option key={building} value={building}>{building}</option>
              ))}
            </select>
          </div>
        </div>
      </div>

      {/* Rooms Grid */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {filteredRooms.map((room) => (
          <div key={room.ROOMID} className="bg-white rounded-lg shadow border border-gray-200 p-6">
            <div className="flex justify-between items-start mb-4">
              <div className="flex items-start space-x-3">
                <div className="text-2xl">{getRoomTypeIcon(room.room_type)}</div>
                <div>
                  <h3 className="text-lg font-semibold text-gray-900">{room.ROOMNUMBER}</h3>
                  <p className="text-sm text-gray-600">{room.ROOMNAME}</p>
                </div>
              </div>
              <div className="flex space-x-2">
                <button
                  onClick={() => handleEdit(room)}
                  className="text-gray-400 hover:text-blue-600"
                >
                  <PencilIcon className="h-4 w-4" />
                </button>
                <button
                  onClick={() => handleDelete(room.ROOMID)}
                  className="text-gray-400 hover:text-red-600"
                >
                  <TrashIcon className="h-4 w-4" />
                </button>
              </div>
            </div>

            <div className="space-y-3">
              <div className="flex items-center text-sm text-gray-600">
                <BuildingOfficeIcon className="h-4 w-4 mr-2" />
                {room.BUILDING}
              </div>

              {room.CAPACITY && (
                <div className="flex items-center text-sm text-gray-600">
                  <UsersIcon className="h-4 w-4 mr-2" />
                  Capacity: {room.CAPACITY} people
                </div>
              )}

              <div className="flex items-center justify-between">
                <span className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium ${getRoomStatusColor(room.STATUS)}`}>
                  {room.STATUS}
                </span>
                {room.room_type && (
                  <span className="text-xs text-gray-500 capitalize">
                    {room.room_type}
                  </span>
                )}
              </div>

              {room.device_count !== undefined && (
                <div className="pt-2 border-t border-gray-200">
                  <div className="flex justify-between text-xs text-gray-500">
                    <span>Devices: {room.device_count || 0}</span>
                    <span>Online: {room.online_devices || 0}</span>
                  </div>
                </div>
              )}
            </div>
          </div>
        ))}
      </div>

      {filteredRooms.length === 0 && !loading && (
        <div className="text-center py-12">
          <BuildingOfficeIcon className="mx-auto h-12 w-12 text-gray-400" />
          <h3 className="mt-2 text-sm font-medium text-gray-900">No rooms found</h3>
          <p className="mt-1 text-sm text-gray-500">
            {searchTerm || filterBuilding ? 'Try adjusting your search filters.' : 'Get started by adding a new room.'}
          </p>
          {!searchTerm && !filterBuilding && (
            <div className="mt-6">
              <button
                onClick={() => setShowModal(true)}
                className="inline-flex items-center px-4 py-2 border border-transparent shadow-sm text-sm font-medium rounded-md text-white bg-blue-600 hover:bg-blue-700"
              >
                <PlusIcon className="h-4 w-4 mr-2" />
                Add Room
              </button>
            </div>
          )}
        </div>
      )}

      {/* Add/Edit Room Modal */}
      {showModal && (
        <div className="fixed inset-0 bg-gray-600 bg-opacity-50 overflow-y-auto h-full w-full z-50">
          <div className="relative top-20 mx-auto p-5 border w-96 shadow-lg rounded-md bg-white">
            <div className="mt-3">
              <h3 className="text-lg font-medium text-gray-900 mb-4">
                {editingRoom ? 'Edit Room' : 'Add New Room'}
              </h3>
              <form onSubmit={handleSubmit} className="space-y-4">
                <div>
                  <label className="block text-sm font-medium text-gray-700">Room Number</label>
                  <input
                    type="text"
                    value={formData.room_number}
                    onChange={(e) => setFormData({ ...formData, room_number: e.target.value })}
                    className="mt-1 block w-full border border-gray-300 rounded-md px-3 py-2"
                    placeholder="e.g., CIT-601"
                    required
                  />
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-700">Room Name</label>
                  <input
                    type="text"
                    value={formData.room_name}
                    onChange={(e) => setFormData({ ...formData, room_name: e.target.value })}
                    className="mt-1 block w-full border border-gray-300 rounded-md px-3 py-2"
                    placeholder="e.g., Computer Laboratory 1"
                    required
                  />
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-700">Building</label>
                  <input
                    type="text"
                    value={formData.building}
                    onChange={(e) => setFormData({ ...formData, building: e.target.value })}
                    className="mt-1 block w-full border border-gray-300 rounded-md px-3 py-2"
                    placeholder="e.g., IT Building"
                    required
                  />
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-700">Room Type</label>
                  <select
                    value={formData.room_type}
                    onChange={(e) => setFormData({ ...formData, room_type: e.target.value })}
                    className="mt-1 block w-full border border-gray-300 rounded-md px-3 py-2"
                    required
                  >
                    {roomTypes.map(type => (
                      <option key={type.value} value={type.value}>{type.label}</option>
                    ))}
                  </select>
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-700">Capacity</label>
                  <input
                    type="number"
                    value={formData.capacity}
                    onChange={(e) => setFormData({ ...formData, capacity: e.target.value })}
                    className="mt-1 block w-full border border-gray-300 rounded-md px-3 py-2"
                    placeholder="e.g., 40"
                    min="1"
                  />
                </div>

                <div className="flex justify-end space-x-3 pt-4">
                  <button
                    type="button"
                    onClick={() => {
                      setShowModal(false);
                      setEditingRoom(null);
                      resetForm();
                    }}
                    className="px-4 py-2 border border-gray-300 rounded-md text-sm font-medium text-gray-700 hover:bg-gray-50"
                  >
                    Cancel
                  </button>
                  <button
                    type="submit"
                    className="px-4 py-2 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-blue-600 hover:bg-blue-700"
                  >
                    {editingRoom ? 'Update' : 'Create'}
                  </button>
                </div>
              </form>
            </div>
          </div>
        </div>
      )}
    </div>
  );
